import {HashRouter as Router, Route, Routes} from 'react-router-dom';
import './App.css';

import { MainPage } from '../Pages/MainPage';
import { CVPage } from '../Pages/CVPage';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<MainPage/>} />
        <Route path='/cv' element={<CVPage/>} />
      </Routes>
    </div>
  );
}

export default App;
